/* ensure that everything gets compiled in the same grade */
static const void *const MR_grade = &MR_GRADE_VAR;


int
main(int argc, char **argv)
{
#ifdef MR_PROFILE_SBRK
   void* old_break;
   void* new_break;
#endif
   int result;
#ifdef MR_PROFILE_SBRK
   old_break = sbrk(0);
#endif
   result = mercury_main(argc, argv);
#ifdef MR_PROFILE_SBRK
   new_break = sbrk(0);
   printf("sbrk delta: %d\n",
       (MR_Integer)new_break - (MR_Integer)old_break);
#endif
   return result;
}
